    let tmp_lit = []; //-> Í∞í Î≥¥Í¥ÄÌï® 
    for(let i = 0; i <Res[5].length; i++){
        tmp_lit[i] = QNA[4].Answers.find(function(data){
            return data.id === Res[5][i]
        });
